cmd4amqaz0000j34i631vs5gk	Shockwave Therapy	Shockwave Therapy	Sử dụng sóng xung kích tạo áp lực cơ học và sức căng lên mô tổn thương, làm tăng tính thấm của màng tế bào, giúp tăng tuần hoàn tại chỗ và chuyển hóa tại phần mô được điều trị.	Uses shock waves to create mechanical pressure and tension on damaged tissue, increasing cell membrane permeability, helping to increase local circulation and metabolism in the treated tissue area.	ACTIVE	t	1	cmdb5m1ah000zj3bdykd3vimr	\N	2025-07-15 08:51:41.867	2025-08-03 11:59:51.957
cmd4amqe00002j34iaaglmv1c	Winback Tecar Therapy	Winback Tecar Therapy	Sử dụng các dòng điện đặc trị tác động lên vùng cơ bị tắt nghẽn. Từ đó kích thích thần kinh cơ, chống teo cơ, kháng viêm, giảm đau.	A non-invasive treatment method, using radiofrequency waves to pass through the skin, acting on the tissue layers below, generating heat to help reduce pain, reduce inflammation, increase circulation and promote tissue regeneration.	ACTIVE	t	3	cmdb5n23d0017j3bdj76p9oad	\N	2025-07-15 08:51:41.977	2025-08-02 04:31:02.33
cmd4amqf10003j34iluszsqvj	Điện xung kết hợp siêu âm		Sử dụng sóng siêu âm tác động đến mô cơ giúp giảm sưng nề mô mềm, giảm đau, giảm co cứng, tăng cường tuần hoàn máu, làm đẩy nhanh quá trình làm lành và hồi phục chức năng.		ACTIVE	t	4	cmdb5nffr001aj3bd5m7jqkx9	\N	2025-07-15 08:51:42.014	2025-08-02 05:10:20.062
cmd4amqd20001j34ic7iup8h0	Laser công suất cao thông minh	LASER THERAPY	Dùng tia Laser tần số cao đi vào mô cơ, mô xương giúp giảm đau, tăng tốc chuyển hóa, giúp phục hồi tế bào nhanh hơn từ đó nâng cao khả năng điều trị và làm lành lại vết thương.	Uses a single wavelength of light, concentrated into a narrow beam, creating a high-energy area. When this beam of light is projected onto the treatment area, it will create a biological effect that stimulates the treatment and regeneration process of the tissue.	ACTIVE	t	5	cmdb5mpxn0014j3bdm5595h1p	\N	2025-07-15 08:51:41.943	2025-08-02 05:11:47.261
